import React,{Component} from 'react';
import Banner from './Banner';

const url="http://localhost:8900/artists"
class Home extends Component {
    constructor(){
        super()

        this.state={
            artists:'iin'
        }
    }


    render(){
        console.log(this.state.artists)
        return(
            <Banner/>
        )
    }

    componentDidMount(){
        fetch(url,{
            method:'GET'
        })
        .then((res) => res.json())
        .then((data) => {
            this.setState({
                artists:data
            })
        })
    }

}


export default Home;
